@chodakowskaewa ja co prawda nie należę do Ambasadorek, ale śledzę od dawna, bo inspiracją jesteś ogromną - jak zdobywać cele i kolejne szczeble kariery robiąc coś z pasji, z sercem, z radością i satysfakcją. To, że dodatkowo na tym zarabiasz to przykład wspaniałego sukcesu, którego wiele osób Ci zazdrości. Dla Nich to sposób na dowartościowanie i podbudowanie. Wiem ile kosztuje własny biznes, ale po to się go prowadzi. Żeby poza ogromną dawką satysfakcji i niesienia ludziom szczęścia ze swojej działaności, móc z tego żyć. 
Po wydaniu swojej pierwszej książki kucharskiej usłyszałem od kogoś „Za szybko młody spełniasz marzenia. Naucz się jeszcze dużo pokory i dopiero próbuj...” - takich przykładów jak widać jest na pęczki. 
Buduj dalej swoje (cytując) „imperium, potęgę, maszynę do pieniędzy (...) - Bóg wie co jeszcze wymyślą” i puszczaj całuski wszystkim zazdrośnikom po prostu robiąc to co kochasz 🤭💗

